import React from 'react';
import RecipeDetail from './components/RecipeDetail';

function RecipeList({ recipes }) {
  return (
    <div className="recipe-list">
      {recipes.map(recipe => (
        <RecipeDetail key={recipe.id} recipe={recipe} />
      ))}
    </div>
  );
}

export default RecipeList;
